import React, { Component } from 'react'

class Visit extends Component {
	// This will loop through the records adding them to the eventually outputted output array
	getRecords = () => {
		let output = [];
		this.props.visitRecord.records.forEach((record)=>{
			if(record.type=='visit'){
				output.push(<div className="activity visit">{record.activity}</div>)
			}else{
				output.push(<div className="activity violation"><span className={'wac-code'}><a href={'http://apps.leg.wa.gov/wac/default.aspx?cite='+record.wac_code.replace(/\(.+\)/,'')} target="_blank">{record.wac_code}</a></span>{record.violation_type}<i>{record.penalty_type}</i></div>)
			}
		})
		return output;
	}

	recordDetails = (id,type) => {
		console.log('record details ',id,type)
	}

	render(){
		return (<tr className={(this.props.visitRecord.hasViolation?'violation':'')}>
			<td xs="auto">{this.props.visitRecord.date}</td>
			<td>{this.getRecords()}</td>
		</tr>)
	}
}

export default Visit;
